import React from "react";
import Layout from "../../layout/Layout/Layout";
import styles from "./System.module.scss";
import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
import Card from "./Card/Card";
import Container from "./Card/Container";
import { faCompass, faBookmark, faStar } from "@fortawesome/free-regular-svg-icons";
import { faFilter } from "@fortawesome/free-solid-svg-icons";
import { Row } from "react-bootstrap";
// import { SystemData } from "./SystemData";
const System = () => {
  return (
    <Layout className={styles.container}>
      <h2>Tính năng định vị & Phân loại vượt trội</h2>
      <p className={styles.title}>
        G-STORE là ứng dụng tuyệt vời để tìm kiếm và kết nối giao thương dựa
        trên nhu cầu thực tiễn của người mua và người bán
      </p>
      <Row>
      <div></div>
      <Container className={styles.content}>
        <Card>
          <FontAwesomeIcon icon={faCompass}/>
        </Card>
        <p>Định vị</p>
        <p>Định vị thông minh cùng tính năng lọc theo điểm bán với vị trí gần nhất</p>
      </Container>
      <Container className={`${styles.content}`}>
        <Card>
          <FontAwesomeIcon icon={faBookmark}/>
        </Card>
      </Container>
      </Row>
    </Layout>
  );
};

export default System;
